    def lis(a):
        n = len(a)
        INF = float('inf')
        d = [INF] * (n + 1)
        d[0] = -INF
        for i in range(n):
            j = bisect_right(d, a[i])
            if d[j - 1] <= a[i] < d[j]:
                d[j] = a[i]
        ans = 0
        for i in range(n + 1):
            if d[i] < INF:
                ans = i
        return ans
    a = sorted(A)
    c = a[:K]
    for i in range(K, N):
        for j in reversed(range(len(c))):
            b = c[:j] + [a[i]] + c[j:]
            if lis(b) == K:
                c = b
                break
    if lis(c) != K and sorted(c) != a:
        return -1
    else:
        return c

